- input: "TEXT\x1CC00009845\x1CX0\x1C\x1CF3XA\x1CResponse to FEC letter dated 10/29/08
    referencing October Quarterly Report (7/1/08-9/30/08):  1.  The expenditure listed
    in Schedule B supporting line 21 (b) which says 'processing & mailing sample ballots
    to absentee voters' was an expenditure not made on behalf of any federal candidate
    listed and met all the conditions listed in the Campaign Guide for such expenditures
    (p49-50).  We simply reproduced the county generic sample ballot, including the
    names of all the candidates, and mailed the sample ballot to those voters who
    had applied to the county for absentee ballots.  This was not a GOTV activity
    nor does it meet the definition of FEA.  2.  The expenditures listed in paragraph
    2 of the referenced letter were all fund raising expenditures for a yard sale
    to benefit the Montgomery County Democratic Central Committee (MCDCC) only and
    did not refer to any clearly identified candidate for federal office nor meet
    any other definitions of FEA.  3.  The expenditure made to 'reimb Lowden rental
    of truck for outdoor fund raiser' was part of the activity described in para.
    2 above, i.e., a yard sale fund raiser to benefit the MCDCC only and meets none
    of the definitions of FEA."
